export class SulibanUniformPack extends BaseNeckProvider implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor) + Uniform.averageMaleBody, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor) + Uniform.averageFemaleBody, BodyType.AverageMale, token), "BodyType.averageFemale"),
        ];
    }

    getRankSwatches() {
        return [
        ];
    }

    getRankIndicator(token: Token) {
        return "";
    }

    getRankBorderIndicator(token: Token) {
        return "";
    }

    getRankBorderDefinitions(token: Token, bordered: boolean) {
        return "";
    }

    getUniformAndVariantBody(token: Token) {
        let result = "";
        let neck = this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.Suliban)
        switch (token.bodyType) {
            case BodyType.AverageMale:
                result = Uniform.averageMaleBody;
                break;
            case BodyType.AverageFemale:
            default:
                result = Uniform.averageFemaleBody;
        }

        return (neck + result).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
    }

    getBorderColor(token: Token) {
        return "#c14242";
    }

    getUniformVariantSwatches(token: Token) {
        return [];
    }

    getBorderLogo(token: Token): string {
        return "";
    }

    isDivisionColorSupported(token: Token): boolean {
        return false;
    }
}